  false,\n\t\"url\": null,\n\t\"notes\": \"The dealer management system (DMS) is a
  data warehouse that stores federal and state dealer permit and license information.
  The issuing agency, whether it is a state or federal agency, provides information
  on the seafood businesses, i.e., company name, mailing/physical address, telephone
  and license/permit number, to the Southeast Fisheries Science Center and these data
  are stored in the DMS.  The system is developed to identify multiple records for
  the same dealer, i.e., dealers that have licenses or permits that are issued by
  different agencies.  These separate dealer codes are linked such that the separate
  licenses/permits can be identified for the same dealer. nnAlthough the DMS was developed
  in 2004, the data in the warehouse begin in 1999.n\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
